import React from 'react';

import CratesLogo from '../assets/images/Crates_Media_Logo.png';
import AthamesLogo from '../assets/images/Athames_Banner.png';
import Placeholder from '../assets/images/Yikes.png';

class Carousel extends React.Component {
  constructor (props) {
    super(props);
    this.state = {
      items: [
        {
          id: 0,
          title: 'Crates Media',
          subTitle: 'Independent Digital Services Agency',
          imgSrc: CratesLogo,
          link: 'crates.media',
          selected: false
        },
        {
          id: 1,
          title: 'llnnll records',
          subTitle: 'Record Label and Production Company',
          imgSrc: AthamesLogo,
          link: 'http://www.athames.com',
          selected: false
        },
        {
          id: 2,
          title: 'More Projects...',
          subTitle: 'See what else I\'ve built',
          imgSrc: Placeholder,
          link: 'https://github.com/ekg-91',
          selected: false
        }
      ]
    };
  }

  render () {
    return (
      <p>Carousel works!</p>
    );
  }
}

export default Carousel;
